import React from 'react'
import { Box } from '@mui/system'
import {useAppDispatch,useAppSelector} from '../../store';

const ShowReport = () => {
  const {userList} = useAppSelector((state)=> state.userReducer)
  return (
    <>
      <Box sx={{padding:'64px'}}>
      {userList.map((user) => (
      <div key={user.id} >
        <h1>{user.name}</h1>
        />
      </div>
    ))}
      </Box>
    </>
  )
}

export default ShowReport
